import React from 'react';
import Canvus from './componets/canvus/canvus'
import Colorpicker from './componets/colorpicker'

class App extends React.Component {

  render() {
    return (
      <div className="App">
      <header className="App-header">
        <Canvus color={Colorpicker.value.Colorpick}/>
        <Colorpicker />
      </header>
    </div>
    );
  }
}

export default App;
